import Link from 'next/link';
import Nav from './Nav';

export default function Header() {
  return (
    <header>
      <Nav />
      <div className="bar">
        <Link href="/">Sick fits</Link>
      </div>
      <div className="sub-bar">
        <p>Search</p>
      </div>
    </header>
  );
}
